import * as knives from "./knives.json";
import * as cases from "./cases.json";
console.log(cases, knives);
export const Data = {
  cases: [
    ...cases.map((value) => {
      return {
        id: value.id,
        title: value.title,
        image: value.image,
        items: value.items,
        specialItems: knives.filter(
          (knivesVal) => knivesVal.id === value.specialItemsCollectionId
        ).items,
      };
    }),
  ],
  caseItems: [
    ...cases.map((value) => {
      return {
        id: value.id,
        title: value.title,
        image: value.image,
        items: value.items,
        specialItems: knives.filter(
          (knivesVal) => knivesVal.id === value.specialItemsCollectionId
        ).items,
      };
    }),
  ],
};
